INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Itaque asperiores et omnis accusamus.', 'Eius deserunt eos ut culpa aut et. Facilis inventore voluptatem soluta velit numquam dolore non. Quis quas vitae perferendis facilis. Dolorem placeat rem repellat enim eum est.', 'Deleniti quam qui optio occaecati consequatur. Consectetur vitae autem sit eligendi occaecati.\nNulla eos tempore libero molestias debitis. At aut praesentium ipsum et accusamus voluptas.', '2016-11-03');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Eveniet adipisci dolor quasi fugit ratione enim.', 'Ex impedit eaque rem mollitia. Cupiditate sit magni architecto et. Quis voluptas aliquam quod molestiae consequuntur repudiandae et.', 'Alias vel qui libero magni illum. Dolore voluptatum blanditiis hic sed voluptatibus quo facere. Porro id neque at et. Explicabo et quo dicta.', '1981-11-23');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Quia in odio maiores a et et dolorum.', 'Qui dolores vero amet assumenda fuga ipsum. Ipsam ullam sapiente expedita fugiat.', 'Et officiis dolore nesciunt commodi ut. Laudantium amet in odit a in enim consequatur dolores. Error quos dolores voluptatem.', '1983-12-06');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Adipisci culpa praesentium neque eaque voluptatem.', 'Ea in labore et suscipit. Qui vel quia odio. Voluptatem necessitatibus ipsum itaque.', 'Omnis officiis aut mollitia magnam aliquam. Porro facilis ut unde. Atque est possimus ullam.', '1986-06-11');
